script: |
  super -f text -I q10478.spq | sort > q10478.out

inputs:
  - name: q10478.spq
    data: |
      SELECT DISTINCT - ( - 73 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 * 21 IN ( + col2 * col2 + - col0 * col2 + - 55 );
  - name: tab1

outputs:
  - name: q10478.out
    data: |
      73
